import Sky from "./components/Sky/Sky";
import Navbar from "./components/Navbar/Navbar";
import { ThemeProvider, createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  typography: { 
    spartan: {
      fontFamily: 'Spartan'
    },
    antonio: {
      fontFamily: 'Antonio'
    },
  },
  link: {
    color: '#747d8c',
    '&:hover': {
      color: 'inherit'
    }
  }
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Sky />
        <Navbar />
      </div>
    </ThemeProvider>

  );
}

export default App;
